let img=document.getElementById("img")
let header=document.getElementById("header")
let info=document.getElementById("info")
let page=document.getElementById("page")
let number=1
function change(){
	if (number ==1) {
		number++
		img.style.backgroundImage="url(data:image/png;base64,)"
		img.style.backgroundSize="100% 100%"
		header.innerText="второй"
		info.innerText="второй"
		page.innerText="2/3"
	}

	
	else if (number ==2){
	
		number++
		img.style.backgroundImage="url(data:image/jpeg;base64,)"
		img.style.backgroundSize="100% 100%"
		header.innerText="третий"
		info.innerText="третий"
		page.innerText="3/3"
	}
}
function back(){
	if (number ==3) {
		number--
		img.style.backgroundImage="url(https://www.kpi.kharkov.ua/rus/wp-content/uploads/sites/3/2016/10/it-1-1024x397.jpg)"
		img.style.backgroundSize="100% 100%"
		header.innerText="второй"
		info.innerText="второй"
		page.innerText="2/3"
	}
	else if (number ==2){
		number--
		img.style.backgroundImage="url(Rectangle 6.png)"
		header.innerText="первый"
		info.innerText="первый"
		page.innerText="1/3"
	}

}